function Home() {

    const getData = async ()=>{
        const tokenJwt = JSON.parse(localStorage.getItem("token"));
        console.log("token ne hi hi",tokenJwt);
        const myHeaders = new Headers();
        myHeaders.append("Authorization",`Bearer ${tokenJwt}`);
         const requestOptions = {
            method: 'GET',
            headers: myHeaders,
            redirect: 'follow'
        };
         try{
               await fetch("http://localhost:8080/test/hello",requestOptions)
                 .then((res) =>{
                     if(res.status === 200){
                         const responseData =  res.text();
                          console.log("oke vao r ", responseData);
                     }
                     else {
                         console.log("loi !!!!");
                     }
                 })
         }
         catch (error){
             console.log("loi roi nhe");
         }
    }

    return (
        <div>
            <button onClick={getData}>Test</button>
        </div>

    );
}

export default Home;
